import React from "react";

const OtherUser = ({user}) => {
  return (
    <div>
      <div className="flex gap-3 p-1 items-center text-neutral-600 hover:bg-slate-500 hover:text-white rounded cursor-pointer">
        <div className="avatar online">
          <div className="w-12 rounded-full">
            <img
              src="https://plus.unsplash.com/premium_photo-1723377620336-94bf506489dd?w=500&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxmZWF0dXJlZC1waG90b3MtZmVlZHwyfHx8ZW58MHx8fHx8"
              alt=""
            />
          </div>
        </div>
        <div className="flex flex-col flex-1" >
            <div className="flex justify-between gap-2">
                <p className="capitalize text-wrap text-white">{user.fullName}</p>
            </div>
        </div>
      </div>
      <div className="divider my-0 py-0"></div>
    </div>
  );
};

export default OtherUser;
